import { SafeAreaView, View } from "react-native-web"
import { Text } from 'react-native-paper';

export const BodyList = ({ label, body }) => {
    return (
        <SafeAreaView>
        <View>
           <Text variant="bodyMedium">Body Medium</Text>
            <View>
                {body}
            </View>
        </View>
        </SafeAreaView>
    )
}
